    //leetcode submit region begin(Prohibit modification and deletion)
    class Solution {
        // 求最终结果，不要过程，考虑动态规划，dp[i][j] 表示从[0,0]出发到[i,j]点的最小体力
        // 可以得到类似dp[i][j] = min(max(dp[i-1][j],abs(h[i][j] - h[i-1][j])), 从下，从左，从右)
        // 有一个问题是，求值的顺序无法确定，不存在可以利用之前计算结果的顺序，所以动态规划不对
        // 其实问题可以抽象加权无向图，求的是特定两点之间权重和最小的路径
        // 思路1，利用并查集，先将所有边移除，再按权重降序的方式，把边添加回去，如果添加之后起点和终点连通了，那么这就是最小的权重
        // 利用给节点编号的方式，简化图的操作，[i,j] -> row*i + j
        public int minimumEffortPath(int[][] heights) {
            int r = heights.length;
            int c = heights[0].length;
            int[] edges = new int[3]; // 0,1-边的两个节点，2-边的effect
            List<int[]> edgeList = new ArrayList<>();
            // 得到所有的边
            for (int i = 0; i < r; i++) {
                for (int j = 0; j < c; j++) {
                    // 计算连接上方和左边的边
                    int h = heights[i][j];
                    if (i - 1 >= 0) {
                        int e = Math.abs(h - heights[i - 1][j]);
                        int num1 = toNum(i - 1, j, c);
                        int num2 = toNum(i, j, c);
                        edgeList.add(new int[]{num1, num2, e});
                    }
                    if (j - 1 >= 0) {
                        int e = Math.abs(h - heights[i][j - 1]);
                        int num1 = toNum(i, j - 1, c);
                        int num2 = toNum(i, j, c);
                        edgeList.add(new int[]{num1, num2, e});
                    }
                }
            }
            edgeList.sort(Comparator.comparingInt(e -> e[2]));
            UnionFind unionFind = new UnionFind(r * c);
            int start = 0;
            int end = r * c - 1;
            for (int[] e : edgeList) {
                unionFind.union(e[0], e[1]);
                // System.out.println(e[0] + "-" + e[1]);
                if (unionFind.find(start) == unionFind.find(end)) {
                    // System.out.println("connected!");
                    return e[2];
                }
            }
            return 0;
        }

        private int toNum(int i, int j, int col) {
            return i * col + j;
        }

        private class UnionFind {
            private int[] parent;
            private int count;

            public UnionFind(int count) {
                this.count = count;
                parent = new int[count];
                for (int i = 0; i < count; i++) {
                    parent[i] = i;
                }
            }

            public int find(int i) {
                while (i != this.parent[i]) {
                    parent[i] = parent[parent[i]];
                    i = parent[i];
                }
                return i;
            }

            public void union(int x, int y) {
                int rootX = find(x);
                int rootY = find(y);
                if (rootX == rootY) return;
                if (rootX < rootY) {
                    parent[rootY] = rootX;
                }
                else {
                    parent[rootX] = rootY;
                }
                count--;
            }
        }
    }
